page_script({init:function(){$(".property-carousel").owlCarousel({items:3,itemsDesktop:[1199,4],itemsDesktopSmall:[979,3],itemsTablet:[768,2],itemsTabletSmall:[1,2],itemsMobile:false,navigation:true,navigationText:['<i class="fa fa-chevron-left"></i>','<i class="fa fa-chevron-right"></i>']});$(".map-canvas").each(function(){var c=new google.maps.LatLng($(this).attr("data-latitude"),$(this).attr("data-longitude"));var d={scrollwheel:false,zoom:13,center:c};var e=new google.maps.Map($(this)[0],d);var b=new google.maps.Marker({position:c});b.setMap(e)});var a=undefined;$(".ps").click(function(){var d=$(this);a=d.parent().parent();var c=$("#show_ps");c.find(".modal-title").text(d.attr("data-name"));if(d.find(".prod_srv_image").length){c.find(".prod_srv_image").attr("style","background-image:url("+d.find(".prod_srv_image").attr("src")+")").show()}else{c.find(".prod_srv_image").hide()}if(d.attr("data-description")!=""){c.find(".description").text(d.attr("data-description")).show()}else{c.find(".description").hide()}if(d.attr("data-sale-price")!=""){c.find(".sale_price>.price_val").text(d.attr("data-sale-price")).show()}else{c.find(".sale_price").hide()}if(d.attr("data-rent-price")!=""){c.find(".rent_price>.price_val").text(d.attr("data-rent-price"))}else{c.find(".rent_price").hide()}history.pushState(undefined,document.title,d.attr("data-url"));c.find(".fb-like").attr("data-href",d.attr("data-url"));c.find(".fb-comments").attr("data-href",d.attr("data-url"));window.fbAsyncInit();c.modal("show")});$(".modal .next").click(function(){var b=a.parent().children().length;var c=a.index();if(c>=b-1){a.parent().children().eq(0).find(".ps").click()}else{a.parent().children().eq(c+1).find(".ps").click()}});$(".modal .previous").click(function(){var b=a.parent().children().length;var c=a.index();if(c<=0){a.parent().children().eq(b-1).find(".ps").click()}else{a.parent().children().eq(c-1).find(".ps").click()}});$(window).keydown(function(b){if(a){switch(b.keyCode){case 39:$(".modal .next").click();break;case 37:$(".modal .previous").click();break}}});if($("input[name=ps_id]").length==1){setTimeout(function(){$(".ps[data-id="+$("input[name=ps_id]").val()+"]").click()},1000)}$("#show_ps").on("hide.bs.modal",function(){history.pushState(undefined,document.title,$("input[name=root_url]").val());a=undefined});$("#message_form").ajaxForm({beforeSubmit:function(){$(".success_msg",$("#message_form")).hide();$(".unhandled_error",$("#message_form")).hide()},success:function(b){try{parsed=JSON.parse(b);if(parsed.status=="success"){$(".success_msg",$("#message_form")).show();$("#message_form")[0].reset()}else{console.log(b);$(".unhandled_error",$("#message_form")).show()}}catch(c){console.log(b);$(".unhandled_error",$("#message_form")).show()}}});$("#message_modal").on("hide.bs.modal",function(){$("#message_form")[0].reset();$(".success_msg",$("#message_form")).hide();$(".unhandled_error",$("#message_form")).hide()});window.fbAsyncInit()}});